    <div class="navheader"><table width="100%" summary="Navigation header"><tr><th colspan="3" align="center">25. Kapitel - Referenzinformationen</th></tr><tr><td width="20%" align="left"><a accesskey="p" href="groupware-client-migrate-connector-manual.php">Zur&uuml;ck</a>&nbsp;</td><th width="60%" align="center">Teil&nbsp;3.&nbsp;Groupware Client</th><td width="20%" align="right">&nbsp;<a accesskey="n" href="groupware-client-reference-registry.php">Weiter</a></td></tr></table><hr></div><div class="chapter" lang="de"><div class="titlepage"><div><div><h2 class="title"><a name="groupware-client-reference"></a>25. Kapitel - Referenzinformationen</h2></div></div></div><div class="toc"><p><b>Inhaltsverzeichnis</b></p><dl><dt><span class="sect1"><a href="groupware-client-reference.php#groupware-client-reference-synced-data">25.1. Synchronisierbare Daten</a></span></dt><dd><dl><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-task">25.1.1. Aufgaben</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-appointment">25.1.2. Termine</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-note">25.1.3. Notizen</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-contact">25.1.4. Kontakte</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-contactgroup">25.1.5. Kontaktgruppen</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-email">25.1.6. E-Mails</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference.php#groupware-client-reference-synced-general">25.1.7. Alle Objekte</a></span></dt></dl></dd><dt><span class="sect1"><a href="groupware-client-reference-registry.php">25.2. Erweiterte Einstellungen in der Registrierung</a></span></dt><dd><dl><dt><span class="sect2"><a href="groupware-client-reference-registry.php#groupware-client-reference-registry-store">25.2.1. Einstellungen f&uuml;r den Store</a></span></dt><dt><span class="sect2"><a href="groupware-client-reference-registry.php#groupware-client-reference-registry-gui">25.2.2. Einstellungen f&uuml;r das Add-In</a></span></dt></dl></dd><dt><span class="sect1"><a href="groupware-client-reference-dataformat.php">25.3. Datenformate</a></span></dt></dl></div><div class="sect1" lang="de"><div class="titlepage"><div><div><h2 class="title" style="clear: both"><a name="groupware-client-reference-synced-data"></a>25.1. Synchronisierbare Daten</h2></div></div></div><p>Der Intra2net Groupware Client synchronisiert die folgenden Daten aus Outlook mit dem
            Server. Alle hier nicht aufgef&uuml;hrten Einstellungen und Daten k&ouml;nnen in Outlook lokal
            zwar ver&auml;ndert werden, aber nicht auf den Server synchronisiert werden. Sie sind daher
            f&uuml;r andere Benutzer nicht sichtbar und sind in einem Backup nicht enthalten.</p><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-task"></a>25.1.1. Aufgaben</h3></div></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-task-supported"></a>25.1.1.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Betreff</p></li><li><p>Kategorien</p></li><li><p>Text/Inhalt (Nur Text)</p></li><li><p>Erstellungsdatum</p></li><li><p>Sensitivit&auml;t und Privat-Markierung</p></li><li><p>Fertiggestellt in %</p></li><li><p>Bearbeitungsstatus: In Arbeit,...</p></li><li><p>Reisekilometer</p></li><li><p>Abrechnunginfo</p></li><li><p>Gesamtaufwand</p></li><li><p>Istaufwand</p></li><li><p>Zuweisung</p></li><li><p>Besitzer</p></li><li><p>F&auml;llig am</p></li><li><p>Beginnt am</p></li><li><p>Erinnerung</p></li><li><p>F&auml;lligkeit</p></li><li><p>Organisierer</p></li><li><p>Ersteller</p></li><li><p>Priorit&auml;t/Wichtigkeit</p></li><li><p>Firma</p></li><li><p>Serienaufgaben mit Ausnahme von Serien, bei denen die folgende Aufgabe
                            in einem definierten Zeitraum nach Abschluss der vorangegangenen Aufgabe
                            erstellt wird</p></li><li><p>Erledigt am</p></li><li><p>Nachverfolgung (nur ja/nein, kein Zeitbezug)</p></li></ul></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-task-unsupported"></a>25.1.1.2. Nicht unterst&uuml;tzte Elemente</h4></div></div></div><p>Ohne Gew&auml;hr auf Vollst&auml;ndigkeit. Im Zweifel werden nur die explizit als
                    unterst&uuml;tzt aufgef&uuml;hrten Elemente unterst&uuml;tzt.</p><div class="itemizedlist"><ul type="disc"><li><p>Text/Inhalt (Formatierter Rich-Text)</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-appointment"></a>25.1.2. Termine</h3></div></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-appointment-supported"></a>25.1.2.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Betreff</p></li><li><p>Kategorien</p></li><li><p>Text/Inhalt (Nur Text)</p></li><li><p>Sensitivit&auml;t und Privat-Markierung</p></li><li><p>Busy-Status / Anzeigen als</p></li><li><p>Start- und Endzeitpunkt, bzw. Ganztags</p></li><li><p>Zeitzonen bei Start- und Endzeitpunkt</p></li><li><p>Organisierer</p></li><li><p>Ersteller</p></li><li><p>Priorit&auml;t</p></li><li><p>Ort</p></li><li><p>Erinnerung (mit nutzerspezifischer Zuordnung)</p></li><li><p>Teilnehmer</p></li><li><p>Terminserien mit Ausnahme von Serien, deren wiederholte Einzeltermine
                            die Tagesgrenze in der gew&auml;hlten Zeitzone &uuml;berschreiten</p></li></ul></div><p>Folgende Ausnahmen k&ouml;nnen f&uuml;r einzelne Termine von Serien verwendet
                    werden:</p><div class="itemizedlist"><ul type="disc"><li><p>L&ouml;schen eines Einzeltermins</p></li><li><p>Ge&auml;nderter Betreff</p></li><li><p>Ge&auml;nderter Text/Inhalt (Nur Text)</p></li><li><p>Ge&auml;nderter Ort</p></li><li><p>&Auml;nderungen der Zeit am selben Kalendertag</p></li></ul></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-appointment-unsupported"></a>25.1.2.2. Nicht unterst&uuml;tzte Elemente</h4></div></div></div><p>Ohne Gew&auml;hr auf Vollst&auml;ndigkeit. Im Zweifel werden nur die explizit als
                    unterst&uuml;tzt aufgef&uuml;hrten Elemente unterst&uuml;tzt.</p><div class="itemizedlist"><ul type="disc"><li><p>Text/Inhalt (Formatierter Rich-Text)</p></li><li><p>Zusage-Status einzelner Teilnehmer</p></li><li><p>Frei w&auml;hlbare Zeitzonen: Es wird immer die aktive Zeitzone
                            verwendet</p></li></ul></div><p>Folgende Ausnahmen k&ouml;nnen f&uuml;r einzelne Termine von Serien nicht verwendet
                    werden:</p><div class="itemizedlist"><ul type="disc"><li><p>Ge&auml;nderte Teilnehmer</p></li><li><p>Verschieben auf einen anderen Kalendertag</p></li><li><p>Ausnahmetermine, die die Tagesgrenze in der gew&auml;hlten Zeitzone
                            &uuml;berschreiten (Ende des Termins an einem anderen Kalendertag als der
                            Start)</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-note"></a>25.1.3. Notizen</h3></div></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-note-supported"></a>25.1.3.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Betreff</p></li><li><p>Kategorien</p></li><li><p>Text/Inhalt</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-contact"></a>25.1.4. Kontakte</h3></div></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-contact-supported"></a>25.1.4.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Vollst&auml;ndiger Name</p></li><li><p>Anrede</p></li><li><p>Vorname</p></li><li><p>Weitere Vornamen</p></li><li><p>Nachname</p></li><li><p>Namenszusatz</p></li><li><p>Initialien</p></li><li><p>Geburtstag</p></li><li><p>Jahrestag</p></li><li><p>Partner/in</p></li><li><p>Spitzname</p></li><li><p>Sensitivit&auml;t und Privat-Markierung</p></li><li><p>Firma</p></li><li><p>Webseite</p></li><li><p>FTP-Site</p></li><li><p>IM-Adresse</p></li><li><p>Abteilung</p></li><li><p>B&uuml;ro</p></li><li><p>Beruf</p></li><li><p>Position</p></li><li><p>Vorgesetzter</p></li><li><p>Assistent</p></li><li><p>Kinder</p></li><li><p>Sprache</p></li><li><p>Abrechnungsinformationen</p></li><li><p>Hobbies</p></li><li><p>Kundennummer</p></li><li><p>Organisationsnummer</p></li><li><p>Sozialversicherungsnummer</p></li><li><p>Reisekilometer</p></li><li><p>E-Mail 1 bis E-Mail 3</p></li><li><p>Adresse gesch&auml;ftlich</p></li><li><p>Adresse privat</p></li><li><p>weitere Adresse</p></li><li><p>Ort</p></li><li><p>bevorzugte Postanschrift</p></li><li><p>Kategorien</p></li><li><p>Notiz (Nur Text)</p></li><li><p>Nachverfolgung (nur ja/nein, kein Zeitbezug)</p></li><li><p>Telefon gesch&auml;ftlich (1 und 2)</p></li><li><p>Telefon privat (1 und 2)</p></li><li><p>Autotelefon</p></li><li><p>Funkruf</p></li><li><p>Haupttelefon</p></li><li><p>Mobiltelefon</p></li><li><p>Pager</p></li><li><p>Tel. f&uuml;r R&uuml;ckmeldung</p></li><li><p>Telefon Assistent</p></li><li><p>Telefonzentrale Firma</p></li><li><p>Texttelefon</p></li><li><p>Weiteres Telefon</p></li><li><p>Fax gesch&auml;ftl.</p></li><li><p>Fax privat</p></li><li><p>Weiteres Fax</p></li><li><p>ISDN</p></li><li><p>Telex</p></li><li><p>Nutzerfeld 1 bis 4</p></li><li><p>Benutzerdefinierte Felder, siehe dazu <a xmlns:d="http://docbook.org/ns/docbook" xmlns:xlink="http://www.w3.org/1999/xlink" href="groupware-client-extended-userdefined.php">Abschnitt&nbsp;22.13, &#8222;Benutzerdefinierte Felder in Kontakten&#8220;</a></p></li></ul></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="d0e9557"></a>25.1.4.2. Bilder</h4></div></div></div><p>Kontakten kann ein Bild zugeordnet werden. Dabei werden folgende Bildformate (MIME-Typen)
                    unterst&uuml;tzt:</p><div class="itemizedlist"><ul type="disc"><li><p>image/jpeg</p></li><li><p>image/png</p></li><li><p>image/bmp, image/x-bmp und image/x-ms-bmp</p></li><li><p>image/gif</p></li><li><p>image/tiff</p></li><li><p>image/x-wmf</p></li><li><p>image/x-emf</p></li><li><p>image/x-icon</p></li></ul></div><p>Beachten Sie, dass Outlook 2010 und &auml;lter in der &Uuml;bersicht nur JPG-Bilder
                    anzeigen, die anderen Bildformate werden nur beim &Ouml;ffnen des Kontakts angezeigt.
                    Ab Outlook 2013 werden die anderen Bildformate auch in der Personenansicht
                    angezeigt.</p><p>Mit Outlook 2003 k&ouml;nnen keine Kontaktbilder auf den Server geschrieben werden.
                    Wird ein Kontakt mit Bild unter Outlook 2003 ge&auml;ndert, so wird dabei das Bild
                    entfernt.</p></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-contact-unsupported"></a>25.1.4.3. Nicht unterst&uuml;tzte Elemente</h4></div></div></div><p>Ohne Gew&auml;hr auf Vollst&auml;ndigkeit. Im Zweifel werden nur die explizit als
                    unterst&uuml;tzt aufgef&uuml;hrten Elemente unterst&uuml;tzt.</p><div class="itemizedlist"><ul type="disc"><li><p>Frei/Gebucht-URL</p></li><li><p>Zertifikate f&uuml;r die Verschl&uuml;sselung/Signierung von Nachrichten</p></li><li><p>Versandoptionen f&uuml;r E-Mails (E-Mail-Adresstyp, Internetformat)</p></li><li><p>Darstellungsoptionen der Visitenkarte</p></li><li><p>Sortierbasis (Speichern unter)</p></li><li><p>Notiz (Formatierter Rich-Text)</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-contactgroup"></a>25.1.5. Kontaktgruppen</h3></div></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-contactgroup-supported"></a>25.1.5.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Name der Kontaktgruppe</p></li><li><p>Anzeigename jedes Mitglieds</p></li><li><p>E-Mail-Adresse jedes Mitglieds</p></li><li><p>Notiz zur Kontaktgruppe (Nur Text)</p></li></ul></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-contactgroup-unsupported"></a>25.1.5.2. Nicht unterst&uuml;tzte Elemente</h4></div></div></div><p>Ohne Gew&auml;hr auf Vollst&auml;ndigkeit. Im Zweifel werden nur die explizit als
                    unterst&uuml;tzt aufgef&uuml;hrten Elemente unterst&uuml;tzt.</p><div class="itemizedlist"><ul type="disc"><li><p>Faxnummer jedes Mitglieds</p></li><li><p>Notiz zur Kontaktgruppe (Formatierter Rich-Text)</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-email"></a>25.1.6. E-Mails</h3></div></div></div><div class="note" style="margin-left: 0.2in; margin-right: 0.5in;"><table border="0" summary="Note"><tr><td rowspan="2" align="center" valign="top" width="25"><img alt="[Hinweis]" src="../images/admon/note.png"></td><th align="left">Hinweis</th></tr><tr><td align="left" valign="top"><p>Dieser Abschnitt betrifft nur E-Mails, die &uuml;ber den Intra2net Groupware
                    Client synchronisiert werden. &Uuml;ber die in Outlook integrierte IMAP-Funktion
                    synchronisierte E-Mails unterliegen den F&auml;higkeiten der jeweiligen Version von
                    Outlook. Weitere Informationen dazu finden Sie in der Dokumentation von
                    Outlook.</p></td></tr></table></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-email-supported"></a>25.1.6.1. Unterst&uuml;tzte Elemente</h4></div></div></div><div class="itemizedlist"><ul type="disc"><li><p>Absender</p></li><li><p>Empf&auml;nger</p></li><li><p>CC</p></li><li><p>BCC</p></li><li><p>Betreff</p></li><li><p>Sendezeitpunkt</p></li><li><p>Empfangszeitpunkt</p></li><li><p>Wichtigkeit</p></li><li><p>Internetkopfzeilen</p></li><li><p>Inhalt (Nur Text und Formatierter Rich-Text)</p></li><li><p>Dateianh&auml;nge</p></li><li><p>Kategorien</p></li><li><p>Nachverfolgung (nur ja/nein, kein Zeitbezug)</p></li></ul></div></div><div class="sect3" lang="de"><div class="titlepage"><div><div><h4 class="title"><a name="groupware-client-reference-synced-email-unsupported"></a>25.1.6.2. Nicht unterst&uuml;tzte Elemente</h4></div></div></div><p>Ohne Gew&auml;hr auf Vollst&auml;ndigkeit. Im Zweifel werden nur die explizit als
                    unterst&uuml;tzt aufgef&uuml;hrten Elemente unterst&uuml;tzt.</p><div class="itemizedlist"><ul type="disc"><li><p>Erinnerungen</p></li></ul></div></div></div><div class="sect2" lang="de"><div class="titlepage"><div><div><h3 class="title"><a name="groupware-client-reference-synced-general"></a>25.1.7. Alle Objekte</h3></div></div></div><p>Generell k&ouml;nnen folgende Elemente mit dem Intra2net Groupware Client nicht
